import React, { Component } from "react";

class TodoCount extends Component {
  render() {
    console.log(this.props.entries);
    var ntodo = this.props.entries.length;
    var done_count = this.props.entries.filter(item => {
      return item.state === "done";
    }).length;
    var ndone_count = this.props.entries.filter(item => {
      return item.state === "ndone";
    }).length;
    return (
      <div>
        <h3>
          TASKS
          <div class="black">
            {/* <a onclick="delall(0);"> */}
            .:
            <b id="count" />
            :.
            {/* </a> */}
          </div>
        </h3>
        <b class="rbold">
          TODO {/* <a onclick="delall(1);"> */}
          .:
          <b id="ttd" />
          :.
          {/* </a> */}
        </b>
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <b class="gbold">
          DONE {/* <a onclick="delall(2);"> */}
          .:
          <b id="td" />
          :.
          {/* </a> */}
        </b>
        <br />
        <br />
        <center>
          TASKS: {ntodo}
          <br /> TODO: {ndone_count} DONE: {done_count}
        </center>
      </div>
    );
  }
}

export default TodoCount;
